import React, {useState} from "react";
import {Button} from "./Button";

import styles from './Counter.module.css'


export const Counter = () => {
    let [counter, setCounter] = useState(0)

    const upCounter = () => {
        if (counter < 5) {
            setCounter(counter + 1)
        }
    }
    const resetCounter = () => {
        setCounter(0)
    }
    return (
        <div className={styles.counterBack}>
            <div className={styles.counter}>{counter}</div>
            <Button
                className={counter < 5 ? styles.up : styles.disabledUp}
                callBack={upCounter}
                name={"add"}/>
            <Button
                className={counter < 1 ? styles.disabledReset : styles.reset}
                callBack={resetCounter}
                name={"reset"}/>
            {counter===5&&<span className={styles.error}>maximum is made.Try reset</span>}

        </div>
    )

}
